import React, { Component } from 'react'
import Home from './pages/Home'
// imports routing components
import {
  BrowserRouter as Router,
  Route,
  Switch
} from 'react-router-dom'
import './App.css'

class App extends Component{
  render(){
    return(
      <React.Fragment>
        <Home />
        <Router>
          <Switch>
            <Route path="/" exact component={ Home } />
            <Route path="/catindex" component={ AboutUs } />
            <Route path="/catshow" component={ Tomato } />
            <Route path="/catnew" component={ Tomato } />
            <Route path="/catedit" component={ Tomato } />
          </Switch>
        </Router>
      </React.Fragment>
    )
  }
}
export default App
